    const brandList = Object.keys(brandData);

    function showSuggestions(input) {
        const suggestionsDiv = document.getElementById('suggestions');
        suggestionsDiv.style.display = input.length > 0 ? 'block' : 'none';
        suggestionsDiv.innerHTML = '';

        const filteredBrands = brandList.filter(brand => brand.toLowerCase().includes(input.toLowerCase()));

        filteredBrands.forEach(brand => {
            const suggestion = document.createElement('div');
            suggestion.innerText = brand;
            suggestion.className = 'suggestion-item';
            suggestion.onclick = () => selectBrand(brand);
            suggestionsDiv.appendChild(suggestion);
        });
    }

    function selectBrand(brand) {
        document.getElementById('brandSearch').value = brand;
        document.getElementById('suggestions').style.display = 'none';

        const data = brandData[brand];
        if (data) {
            const trace = {
                labels: ['Boon', 'Loss'],
                values: [data.boon, data.loss],
                type: 'pie',
                hole: .3,
                title: { text: brand + ' - Boon vs Loss', font: { size: 18, color: '#FFD700' } },
                marker: { colors: ['#4F65FF', '#FF4545'] }
            };
            const layout = {
                template: 'plotly_dark',  // Apply dark theme
                paper_bgcolor: '#111',
                plot_bgcolor: '#111',
                showlegend: true,
                legend: { font: { color: '#FFD700' } }  // Ensure legend text is gold
            };
            Plotly.newPlot('pieChart', [trace], layout);
        } else {
            document.getElementById('pieChart').innerHTML = '<p style="color: #FFD700;">No data available for this brand.</p>';
        }
    }
